import React, {Component} from 'react';

import './MainNavigation.css';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Image from 'react-bootstrap/Image';
import Button from 'react-bootstrap/Button';
import { NavLink } from 'react-router-dom';



class mainNavigation extends Component {
    constructor(props){
        super(props);
        this.state = {
            expanded: false
        }
    }

    render() {
        return (
        <Navbar expanded={expanded} expand="md" bg="dark" variant="dark">
            <Navbar.Brand>
                <Nav.Link to="/home">
                    <Image src='./imgs/logo.png'/>
                </Nav.Link>
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" onClick={() => setExpanded(expanded ? false : "expanded")}/>
            <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
                    <Nav.Link eventKey={2} className="mainItem">
                        <NavLink to="/about">
                            About
                        </NavLink>
                    </Nav.Link>
                    <Nav.Link eventKey="link-1" to="/menu" className="mainItem">
                            Menu
                    </Nav.Link>
                        <NavLink eventKey={4} to="/entertainment" className="mainItem">
                            Entertainment
                        </NavLink>

                    <Nav.Link eventKey={5} className="mainItem">
                        <NavLink to="/events">
                            Events
                        </NavLink>
                    </Nav.Link>
            </Nav>

            {/* AUTH BUTTONS */}
            <Nav className="authBtns">
                <Nav.Link to="/login">
                        <Button>Login</Button>
                </Nav.Link>
                <Nav.Link to="/signup">
                    <Button>Join</Button>
                </Nav.Link>
            </Nav>
        </Navbar.Collapse>
        </Navbar>
        )
    }
}

export default mainNavigation;
